description:
Waiting for Gaga

Arts Documentary hosted by Miranda Sawyer, published by BBC broadcasted as part of BBC The Culture Show series in 2013 - English narration


Information
------------------------------

More than 40 million people follow Lady Gaga on Twitter. Can they possibly be wrong? For her fans, the Little Monsters, Gaga is not just a star - she is a mother figure and a fellow sufferer. As her long-awaited third album ARTPOP is released, the Culture Show has been promised an exclusive interview. But when will it happen? And where? Miranda Sawyer and the Little Monsters are all waiting for Gaga.

